INSERT INTO `answer_comments` VALUES (1,'The soldering issue was brought up by our department before. We were always told it was a matter of cost. It would seem now like the cost of not doing it is outstripping the cost of doing it.',5,1,'2015-11-20 04:52:27','2015-11-20 05:12:25'),(2,'\r\nYou’re correct, it was a cost issue. Not that we have more information, I think we should look at it from a total cost issue.',9,1,'2015-11-20 04:52:35','2015-11-20 05:12:32'),(3,'I agree. The focus has been too much on cost containment without the understanding of how our product makes it to the end channel through the supply chain.',3,2,'2015-11-20 05:06:38','2015-11-20 05:12:39');
