INSERT INTO `answers` VALUES (1,1,2,'It has come to my attention, through some of our dealers, that the quantity of soldering material we use on the pins is half of that our competitors. Maybe this could contribute to the problem?','2015-11-20 04:44:52','2015-11-27 22:48:44',0),(2,1,1,'I think part of the problem is the flimsy packaging that our circuit boards go out with. With just a flex pack, the chances of the product getting damaged in transit are very high.','2015-11-20 05:06:12','2015-11-23 20:47:35',1);
