INSERT INTO `events` VALUES (2,'Quarterly meeting','The quaterly meeting for the Women\'s Network Group is coming up next month. During the meeting, we will appoint a director for our newly created team of ERG liaison and senor management mentorship. Looking forward to seeing everyone in meeting room R-3421.','2015-11-19 18:00:00','2015-11-19 20:00:00','Meeting room R-3422',25,15,'2015-10-25 18:03:11','2015-11-25 18:52:26'),(3,'Join ERG campaign','It\'s here! We are being paired with another ERG and entrusted to solve one of our organisation\'s thorniest problems. Be on the lookout for a Diverst invitation in the coming week.','2015-10-29 18:09:00','2015-10-29 19:09:00','NYC office, 5th floor lobby',75,15,'2015-10-25 18:11:50','2015-10-25 18:11:50'),(4,'Annual WiNG ball','The annual WiNG ball is scheduled for January the 2nd at 8pm in the Grand Ballroom of the Plaza Hotel, NYC. Please RSVP no later than December 1st at 5pm.','2015-11-25 18:15:09','2015-11-25 18:15:09','Grand Ballroom, Plaza Hotel, NYC',150,15,'2015-10-25 18:14:17','2015-10-25 18:15:09'),(5,'allo','test','2015-11-24 23:36:00','2015-11-24 23:36:00','',NULL,11,'2015-11-24 23:36:51','2015-11-24 23:36:51');
