INSERT INTO `group_messages` VALUES (1,15,'Problem solving campaign','We have had a great run so far but the year is not over. We have performed well across the board and are just a few points ahead of our closest ERG. There is a new Problem Solving clawing starting next week and we need all hands on deck. Let\'s show them what the AALF can do !!','2015-10-25 17:42:54','2015-10-25 17:42:54'),(2,15,'Mentorship programs','It has come to my attention that many of you have signed-up for the CEOs mentorship program. Congratulations, we are the highly represented ERG for for the Rob Clark\'s mentorship initiative.','2015-10-25 17:43:07','2015-10-25 17:43:07'),(3,15,'Innovation and women\'s ERG','I am happy to announce that WiNG has been awarded the Most Innovative ERG Award by the Diversity Inc Advisory Board. We also will be working closely with our fellow ERGs to transfer our best practices for them to benefit from.','2015-10-25 17:43:50','2015-10-25 17:43:50');
