INSERT INTO `groups` VALUES (11,1,'Honoring Our Nation\'s finest with Opportunity and Respect','The mission of the Military Resource Group is to provide support, guidance and resources to employees and families connected to the military. HONOR accomplishes this by offering development opportunities, providing a forum to recognize and celebrate contributions made to our country, and establishing partnerships with community groups that support veterans, active duty, National Guard and military reserve.','2015-10-25 17:00:38','2015-10-25 17:00:38','CB_Careers_DvlpTrain_EmpBusGrps_HONOR_60x60337-688726.jpg','image/jpeg',18231,'2015-10-25 17:00:37',0),(12,1,'African American Leadership Forum (AALF)','AALF strives to serve as a champion to support the culture of diversity within Sodexo by promoting efforts that increase the value of the career journey for our constituents. AALF creates and maintains an inclusive connection amongst members and contributes to a raised awareness of the particular needs and experiences of African Americans. ','2015-10-25 17:01:16','2015-10-25 17:01:16','CB_Careers_DvlpTrain_EmpBusGrps_AALF_60x60337-688723.jpg','image/jpeg',16105,'2015-10-25 17:01:16',0),(13,1,'Intergenerational Network Group (i-Gen)','i-Gen’s goal is to leverage multi-generational differences and commonalities for personal and professional growth in order to attract and retain talent that enhances Sodexo\'s strength of diversity and inclusion in the marketplace.','2015-10-25 17:01:58','2015-10-25 17:01:58','CB_Careers_DvlpTrain_EmpBusGrps_i-Gen_60x60337-688728.jpg','image/jpeg',17177,'2015-10-25 17:01:58',0),(14,1,'Native American and Aboriginal Council (NAAC)','Deepening our understanding of native peoples and their heritages and values is the key focus of NAAC. In our communities and in our membership, we are committed to individual professional growth through education, recruitment, retention, community services and developing partnerships that enhance mutual business opportunities.','2015-10-25 17:02:49','2015-10-25 17:02:49','CB_Careers_DvlpTrain_EmpBusGrps_NAAC_60x60337-688730.jpg','image/jpeg',17155,'2015-10-25 17:02:49',0),(15,1,'Women\'s Network Group (WiNG)','WiNG seeks to foster a culture where enhancing women\'s individual and professional growth contributes to the global success of our company and the communities we serve. The development, promotion and retention of Sodexo’s talented women are key.','2015-10-25 17:03:34','2015-11-25 21:25:49','CB_Careers_DvlpTrain_EmpBusGrps_WiNG_60x60337-688740.jpg','image/jpeg',19068,'2015-10-25 17:03:34',0),(16,1,'Sodexo Organisation for disAbilities Resources (SOAR)','SOAR seeks to raise awareness, provide education and resources, and proactively create a culture that embraces, values and fully utilizes persons with disabilities. SOAR supports seeing the abilities in employees in a people first environment.','2015-10-25 17:04:28','2015-10-25 17:04:28','SoAR1337-722290.jpg','image/jpeg',15920,'2015-10-25 17:04:28',0);
