INSERT INTO `questions` VALUES (1,'How do we deal with the high return rate of our latest “Demico” product?','The return rates of \"Demico\" has been steadily increasing due to the high number of casing failures. We\'ve identified the problem: our latest injection molding technique is not as efficient as we thought and leaves us with a weaker shell than planned.',1,'2015-11-20 04:41:58','2015-11-20 14:40:11',NULL,'Thanks for the feedback. We\'re going to go with x because y.'),(2,'How could we improve our QA process to identify these kind of failures?','The issue is not only that such defects were produced, but that they weren\'t detected at the QA phase. We\'ve already added manual verification in our product verification checklist, but these kind of failures are undetectable without computer-assisted imagery tools, and such tools are very expensive. Is there another way to add detection to these kind of issues in our QA process?',1,'2015-11-20 04:41:58','2015-11-20 04:41:58',NULL,NULL),(3,'How can we reduce our QA costs?','The addition of a manual identification process was very costly and, while it\'s helped us better identify issues and lower our return rates by 25%, we are now facing an increase in product cost of almost 12%, which is almost what we were losing by having high return rates. Are there any cheaper alternatives out there that would help us achieve similar results while costing less?',1,'2015-11-20 04:41:58','2015-11-20 13:54:52','2015-11-20 13:54:52','Thanks for all the input.');
/*!40000 ALTER TABLE `questions` ENABLE KEYS */;
